★革の表面にしみ、汚れ、傷が付きやすく、生前の傷、血筋があり、また染めによる顕著な色落ちが
見られますが、これを本来の革の表情、性質の一環として捉え、出来る限り大切に使用しています。　<BR>
味わい深い革と接して頂くための注意点としてご理解下さい。　<BR>
★手染めの工程は全て手作業で行われる為、全ての製品は均一ではありません。　<BR>
上記写真と発送商品は多少異なりますが、ご了承お願い致します。　<BR>



